import { View,Text,Image, StyleSheet } from 'react-native';

export const Tab = () =>{
    return(
    <View style={styles.TabView}>
        <Image style={{marginRight: 57,}} source={require('../components/homebutton1.png')}/>
        <Image style={{marginBottom: 27,}} source={require('../components/plusbutton.png')}/>
        <Image style={{marginLeft: 57,}} source={require('../components/historybutton2.png')}/>
      </View>);
} 

const styles = StyleSheet.create({
    TabView:{
        top: 171,
        height: 79,
        justifyContent: 'center',
        flexDirection: 'row',
        alignItems:'center',
        //backgroundColor:'green'
    },
})
